import React from 'react';
import './HomePage.css';

const jobCategories = [
  { icon: "üõ†Ô∏è", label: "Farming help" },
  { icon: "üßµ", label: "Sewing" },
  { icon: "üè∫", label: "Handicrafts" },
  { icon: "üíª", label: "Computer work" },
  { icon: "üìñ", label: "Tutoring" },
  { icon: "üßë‚Äçüè´", label: "Other" }
];

const HomePage = () => {
  return (
    <div className="app-wrapper">
      <header className="app-header">
        <div className="logo">üåæ FREELANCE RURAL</div>
        <div className="top-icons">
          <span>üîç</span>
          <span>EN</span>
        </div>
      </header>

      <main className="app-main">
        <h1>Find work.<br />Hire talent.</h1>

        <div className="action-buttons">
          <button className="find-btn">Find Jobs</button>
          <button className="post-btn">Post a Job</button>
        </div>

        <div className="categories">
          {jobCategories.map((job, index) => (
            <div className="category-card" key={index}>
              <div className="icon">{job.icon}</div>
              <div className="label">{job.label}</div>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
};

export default HomePage;
